  \"Reliable Direct Bond Copper Ceramic Packages for High Temperature Power Electronics
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 11,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T21:07:32.066387\",\n\t\"name\":
  \"reliable-direct-bond-copper-ceramic-packages-for-high-temperature-power-electronics-projec\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed program will develop highly
  reliable, hermetic, Si3N4 ceramic multichip modules to integrate commercially available
  SiC power devices to build power electronic modules for reliable operation above
  500:C in extreme environments of space exploration.  The Phase I program will demonstrate
  a reliable direct bond copper (DBC) process for Si3N4 substrates, develop high current
  carrying hermetic feedthroughs, an innovative transient liquid phase (TLP) die attach,
  and a monometallic wire bonding capable of reliable operation above 500:C; and fabricate
  and test a hermetic single-chip module. \",\n\t\"license_title\": \"U.S. Government
